import "./index.css";
import "..../src/base"

function Login() {
    return (
        <div className="caixa-login">


            <div className="titulo-login">
                <h1 >Login</h1>
            </div>


            <div className="grupo">
                <label for="email">E-mail:</label> <br/>
                <input id="email" type="text" placeholder="Digite seu e-mail"/><br/><br/>
                </div>


                    <div className="grupo">
                        <label for="senha">Senha:</label> <br/>
                            <input id="senha" type="passoword" placeholder="Digite sua senha"/> <br/><br/>
                    </div>


                    <div className="esqueci-minha-senha">
                        <a href="#">Esqueci minha senha</a>
                    </div>
                    <br/>
                    <button id="btn-entrar">Entrar</button>
                </div>
                    );
};
export default Login;
